import React from "react";
import "./Review.css";
function Reviews() {
  return (
    <>
      <section className="review" id="review">
        <div className="box">
          <p>208K</p>
          <p>Reviews</p>
        </div>
        <div className="box">
          <p>2521K</p>
          <p>watching</p>
        </div>
        <div className="box">
          <p>4056K</p>
          <p>subscribe</p>
        </div>
      </section>
    </>
  );
}

export default Reviews;
